eed.\r\nspeed-high  : Fan spin using the highest speed.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27556,4,'{$SNMP_COMMUNITY}','discovery[{#IFOPERSTATUS},1.3.6.1.2.1.2.2.1.8,{#IFADMINSTATUS},1.3.6.1.2.1.2.2.1.7,{#IFALIAS},1.3.6.1.2.1.31.1.1.1.18,{#IFNAME},1.3.6.1.2.1.31.1.1.1.1,{#IFDESCR},1.3.6.1.2.1.2.2.1.2,{#IFTYPE},1.3.6.1.2.1.2.2.1.3]',10224,'Network Interfaces Discovery','net.if.discovery','1h','90d','0',0,4,'','','',0,'','','','',0,'',27098,NULL,'','',0,'','','','',0,1,NULL,'','Discovering interfaces from IF-MIB. Interfaces are not discovered:\r\n- with down(2) Administrative status\r\n- with notPresent(6) Operational status\r\n- loopbacks',0,'30d',0,0,0,'',1,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27557,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.13.{#SNMPINDEX}',10224,'Interface {#IFNAME}({#IFALIAS}): Inbound packets discarded','net.if.in.discards[ifInDiscards.{#SNMPINDEX}]','5m','1w','365d',0,3,'','','',0,'','','','',0,'',27099,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe number of inbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent their being deliverable to a higher-layer protocol.\r\nOne possible reason for discarding such a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of the management system,\r\nand at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27558,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.14.{#SNMPINDEX}',10224,'Interface {#IFNAME}({#IFALIAS}): Inbound packets with errors','net.if.in.errors[ifInErrors.{#SNMPINDEX}]','3m','1w','365d',0,3,'','','',0,'','','','',0,'',27106,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nFor packet-oriented interfaces, the number of inbound packets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of inbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27559,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.6.{#SNMPINDEX}',10224,'Interface {#IFNAME}({#IFALIAS}): Bits received','net.if.in[ifHCInOctets.{#SNMPINDEX}]','3m','30d','365d',0,3,'','bps','',0,'','','','',0,'',27104,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe total number of octets received on the interface,including framing characters.  This object is a 64-bit version of ifInOctets. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27560,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.19.{#SNMPINDEX}',10224,'Interface {#IFNAME}({#IFALIAS}): Outbound packets discarded','net.if.out.discards[ifOutDiscards.{#SNMPINDEX}]','5m','1w','365d',0,3,'','','',0,'','','','',0,'',27102,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe number of outbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent their being deliverable to a higher-layer protocol.\r\nOne possible reason for discarding such a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of the management system,\r\nand at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27561,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.20.{#SNMPINDEX}',1022