INDEX}]','3m','1w','365d',0,3,'','','',0,'','','','',0,'',27106,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nFor packet-oriented interfaces, the number of inbound packets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of inbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27875,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.6.{#SNMPINDEX}',10233,'Interface {#IFNAME}({#IFALIAS}): Bits received','net.if.in[ifHCInOctets.{#SNMPINDEX}]','3m','30d','365d',0,3,'','bps','',0,'','','','',0,'',27104,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe total number of octets received on the interface,including framing characters.  This object is a 64-bit version of ifInOctets. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27876,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.19.{#SNMPINDEX}',10233,'Interface {#IFNAME}({#IFALIAS}): Outbound packets discarded','net.if.out.discards[ifOutDiscards.{#SNMPINDEX}]','5m','1w','365d',0,3,'','','',0,'','','','',0,'',27102,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe number of outbound packets which were chosen to be discarded\r\neven though no errors had been detected to prevent their being deliverable to a higher-layer protocol.\r\nOne possible reason for discarding such a packet could be to free up buffer space.\r\nDiscontinuities in the value of this counter can occur at re-initialization of 