idth.  For a sub-layer which has no concept of bandwidth, this object should be zero.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27952,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#SNMPINDEX}',10235,'Interface {#IFNAME}({#IFALIAS}): Operational status','net.if.status[ifOperStatus.{#SNMPINDEX}]','1m','2w','0d',0,3,'','','',0,'','','','',0,'',27107,20,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe current operational state of the interface.\r\n- The testing(3) state indicates that no operational packet scan be passed\r\n- If ifAdminStatus is down(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27953,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10235,'Interface {#IFNAME}({#IFALIAS}): Interface type','net.if.type[ifType.{#SNMPINDEX}]','1h','1w','0d',0,3,'','','',0,'','','','',0,'',27100,21,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe type of interface.\r\nAdditional values for ifType are assigned by the Internet Assigned NumbersAuthority (IANA),\r\nthrough updating the syntax of the IANAifType textual convention.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27954,4,'{$SNMP_COMMUNITY}','discovery[{#SNMPVALUE},1.3.6.1.2.1.10.7.2.1.19,{#IFOPERSTATUS},1.3.6.1.2.1.2.2.1.8,{#IFALIAS},1.3.6.1.2.1.31.1.1.1.18,{#IFNAME},1.3.6.1.2.1.31.1.1.1.1,{#IFDESCR},1.3.6.1.2.1.2.2.1.2]',10235,'EtherLike-MIB Discovery','net.if.duplex.discovery','1h','90d','0',0,4,'','','',0,'','','','',0,'',27031,NULL,'','',0,'','','','',0,1,NULL,'','Discovering interfaces from IF-MIB and EtherLike-MIB. Interfaces with up(1) Operational Status are discovered.',0,'30d',0,0,0,'',1,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27955,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.10.7.2.1.19.{#SNMPINDEX}',10235,'Interface {#IFNAME}({#IFALIAS}): Duplex status','net.if.duplex[dot3StatsDuplexStatus.{#SNMPINDEX}]','5m','1w','0d',0,3,'','','',0,'','','','',0,'',27032,19,'','',0,'','','','',0,2,NULL,'','MIB: EtherLike-MIB\r\nThe current mode of operation of the MAC\r\nentity.  \'unknown\' indicates that the current\r\nduplex mode could not be determined.\r\n\r\nManagement control of the duplex mode is\r\naccomplished through the MAU MIB.  When\r\nan interface does not support autonegotiation,\r\nor when autonegotiation is not enabled, the\r\nduplex mode is controlled using\r\nifMauDefaultType.  When autonegotiation is\r\nsupported and enabled, duplex mode is controlled\r\nusing ifMauAutoNegAdvertisedBits.  In either\r\ncase, the currently operating duplex mode is\r\nreflected both in this object and in ifMauType.\r\n\r\nNote that this object provides redundant\r\ninformation with ifMauType.  Normally, redundant\r\nobjects are discouraged.  However, in this\r\ninstance, it allows a management application to\r\ndetermine the duplex status of an interface\r\nwithout having to know every possible value of\r\nifMauType.  This was felt to be sufficiently\r\nvaluable to justify the redundancy.\r\nReference: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27956,3,'','',10235,'ICMP ping','icmpping','1m','1w','365d',0,3,'','','',0,'','','','',0,'',27149,1,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27957,3,'','',10235,'ICMP loss','icmppingloss','1m','1w','36