e bandwidth of the interface is greater than the maximum value reportable by this object then\r\nthis object should report its maximum value (4,294,967,295) and ifHighSpeed must be used to report the interace\'s speed.\r\nFor a sub-layer which has no concept of bandwidth, this object should be zero.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27984,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#SNMPINDEX}',10236,'Interface {#IFDESCR}: Operational status','net.if.status[ifOperStatus.{#SNMPINDEX}]','1m','2w','0d',0,3,'','','',0,'','','','',0,'',27087,20,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe current operational state of the interface.\r\n- The testing(3) state indicates that no operational packet scan be passed\r\n- If ifAdminStatus is down(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27985,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10236,'Interface {#IFDESCR}: Interface type','net.if.type[ifType.{#SNMPINDEX}]','1h','1w','0d',0,3,'','','',0,'','','','',0,'',27080,21,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe type of interface.\r\nAdditional values for ifType are assigned by the Internet Assigned NumbersAuthority (IANA),\r\nthrough updating the syntax of the IANAifType textual convention.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(27986,3,'','',10236,'ICMP ping','icmpping',