ckets that contained errors preventing them from being deliverable to a higher-layer protocol.  For character-oriented or fixed-length interfaces, the number of outbound transmission units that contained errors preventing them from being deliverable to a higher-layer protocol. Discontinuities in the value of this counter can occur at re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28103,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.16.{#SNMPINDEX}',10249,'Interface {#IFNAME}({#IFALIAS}): Bits sent','net.if.out[ifOutOctets.{#SNMPINDEX}]','3m','30d','365d',0,3,'','bps','',0,'','','','',0,'',27125,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe total number of octets transmitted out of the interface, including framing characters. Discontinuities in the value of this counter can occurat re-initialization of the management system, and at other times as indicated by the value of ifCounterDiscontinuityTime.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28104,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.31.1.1.1.15.{#SNMPINDEX}',10249,'Interface {#IFNAME}({#IFALIAS}): Speed','net.if.speed[ifHighSpeed.{#SNMPINDEX}]','5m','1w','0d',0,3,'','bps','',0,'','','','',0,'',27121,NULL,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nAn estimate of the interface\'s current bandwidth in units of 1,000,000 bits per second.  If this object reports a value of `n\' then the speed of the interface is somewhere in the range of `n-500,000\' to`n+499,999\'.  For interfaces which do not vary in bandwidth or for those where no accurate estimation can be made, this object should contain the nominal bandwidth.  For a sub-layer which has no concept of bandwidth, this object should be zero.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28105,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.8.{#S