(2) then ifOperStatus should be down(2)\r\n- If ifAdminStatus is changed to up(1) then ifOperStatus should change to up(1) if the interface is ready to transmit and receive network traffic\r\n- It should change todormant(5) if the interface is waiting for external actions (such as a serial line waiting for an incoming connection)\r\n- It should remain in the down(2) state if and only if there is a fault that prevents it from going to the up(1) state\r\n- It should remain in the notPresent(6) state if the interface has missing(typically, hardware) components.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28232,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.2.2.1.3.{#SNMPINDEX}',10253,'Interface {#IFNAME}({#IFALIAS}): Interface type','net.if.type[ifType.{#SNMPINDEX}]','1h','1w','0d',0,3,'','','',0,'','','','',0,'',27100,21,'','',0,'','','','',0,2,NULL,'','MIB: IF-MIB\r\nThe type of interface.\r\nAdditional values for ifType are assigned by the Internet Assigned NumbersAuthority (IANA),\r\nthrough updating the syntax of the IANAifType textual convention.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28233,3,'','',10253,'ICMP ping','icmpping','1m','1w','365d',0,3,'','','',0,'','','','',0,'',27149,1,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28234,3,'','',10253,'ICMP loss','icmppingloss','1m','1w','365d',0,0,'','%','',0,'','','','',0,'',27150,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28235,3,'','',10253,'ICMP response time','icmppingsec','1m','1w','365d',0,0,'','s','',0,'','','','',0,'',27151,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28236,17,'','',10253,'SNMP traps (fallback)','snmptrap.fallback','5m','2w','0',0,2,'','','',0,'','','','',0,'hh:mm:sszyyyy/MM/dd',27157,NULL,'','',0,'','','','