undant\r\nobjects are discouraged.  However, in this\r\ninstance, it allows a management application to\r\ndetermine the duplex status of an interface\r\nwithout having to know every possible value of\r\nifMauType.  This was felt to be sufficiently\r\nvaluable to justify the redundancy.\r\nReference: [IEEE 802.3 Std.], 30.3.1.1.32,aDuplexStatus.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28282,3,'','',10254,'ICMP ping','icmpping','1m','1w','365d',0,3,'','','',0,'','','','',0,'',27149,1,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28283,3,'','',10254,'ICMP loss','icmppingloss','1m','1w','365d',0,0,'','%','',0,'','','','',0,'',27150,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28284,3,'','',10254,'ICMP response time','icmppingsec','1m','1w','365d',0,0,'','s','',0,'','','','',0,'',27151,NULL,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28285,17,'','',10254,'SNMP traps (fallback)','snmptrap.fallback','5m','2w','0',0,2,'','','',0,'','','','',0,'hh:mm:sszyyyy/MM/dd',27157,NULL,'','',0,'','','','',0,0,NULL,'','Item is used to collect all SNMP traps unmatched by other snmptrap items',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28286,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.4.0',10254,'Device contact details','system.contact','1h','2w','0',0,1,'','','',0,'','','','',0,'',27156,NULL,'','',0,'','','','',0,0,NULL,'','MIB: SNMPv2-MIB\r\nThe textual identification of the contact person for this managed node, together with information on how to contact this person.  If no contact information is known, the value is the zero-length string.',23,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28287,4,'{$SNMP_COMMUNITY}','1.3.6.1.2.1.1.1.0',10254,'Device description','system.d