}: Disk array controller status','system.hw.diskarray.status[cpqDaCntlrCondition.{#SNMPINDEX}]','5m','1w','0d',0,3,'','','',0,'','','','',0,'',NULL,54,'','',0,'','','','',0,2,NULL,'','MIB: CPQIDA-MIB\r\nThis value represents the overall condition of this controller,\r\nand any associated logical drives,physical drives, and array accelerators.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28414,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.2.1.1.2.{#SNMPINDEX}',10256,'{#CNTLR_LOCATION}: Disk array controller model','system.hw.diskarray.model[cpqDaCntlrModel.{#SNMPINDEX}]','1d','30d','0d',0,3,'','','',0,'','','','',0,'',NULL,56,'','',0,'','','','',0,2,NULL,'','MIB: CPQIDA-MIB\r\nArray Controller Model. The type of controller card.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28415,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.2.2.1.2.{#SNMPINDEX}',10256,'#{#CACHE_CNTRL_INDEX}: Disk array cache controller status','system.hw.diskarray.cache.status[cpqDaAccelStatus.{#SNMPINDEX}]','5m','1w','0d',0,3,'','','',0,'','','','',0,'',NULL,71,'','',0,'','','','',0,2,NULL,'','MIB: CPQIDA-MIB\r\nCache Module/Operations Status. This describes the status of the cache module and/or cache operations.\r\nNote that for some controller models, a cache module board that physically attaches to the controller or chipset may not be an available option.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28416,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.2.2.1.6.{#SNMPINDEX}',10256,'#{#CACHE_CNTRL_INDEX}: Disk array cache controller battery status','system.hw.diskarray.cache.battery.status[cpqDaAccelBattery.{#SNMPINDEX}]','5m','1w','0d',0,3,'','','',0,'','','','',0,'',NULL,72,'','',0,'','','','',0,2,NULL,'','MIB: CPQIDA-MIB\r\nCache Module Board Backup Power Status. This monitors the status of each backup power source on the board.\r\nThe backup power source can only recharge when the system has power applied. The type of backup power source used is indicated by cpqDaAccelBackupPowerSource.\r\nThe following values are valid:\r\nOther (1)  Indicates that the instrument agent does not recognize  backup power status.  You may need to update your software.\r\n\r\nOk (2)  The backup power source is fully charged.\r\n\r\nRecharging (3)  The array controller has one or more cache module backup power  sources that are recharging.\r\nCache module operations such as Battery/Flash Backed Write Cache, Expansion, Extension and Migration are temporarily suspended until the backup power source is fully charged.\r\nCache module operations will automatically resume  when charging is complete.\r\n\r\nFailed (4)  The battery pack is below the sufficient voltage level and  has not recharged in 36 hours.\r\nYour Cache Module board  needs to be serviced.\r\n\r\nDegraded (5)  The battery is still operating, however, one of the batteries  in the pack has failed to recharge properly.\r\nYour Cache  Module board should be serviced as soon as possible.\r\n\r\nNotPresent (6)  A backup power source is not present on the cache module board. Some controllers do not have backup power sources.\r\n\r\nCapacitor Failed (7)  The flash backed cache module capacitor is below the sufficient voltage level and has not recharged in 10 minutes.  Your Cache Module board needs to be serviced.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28417,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.5.1.1.6.{#SNMPINDEX}',10256,'{#DISK_LOCATION}: Physical disk status','system.hw.physicaldisk.status[cpqDaPhyDrvStatus.{#SNMPINDEX}]','3m','30d','0d',0,3,'','','',0,'','','','',0,'',NULL,57,'','',0,'','','','',0,2,NULL,'','MIB: CPQIDA-MIB\r\nPhysical Drive Status. This shows the status of the physical drive. The following values are valid for the physical drive status:\r\nother (1)  Indicates that the instrument agent does not recognize  the drive.\r\nYou may need to upgrade your instrument agent  and/or driver software.\r\nok (2)  Indicates the drive is functioning properly.\r\nfailed (3)  Indicates that the drive is no longer operating and  should be replaced.\r\npredictiveFailure(4)  Indicates that the drive has a predictive failure error and  should be replaced.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28418,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.5.1.1.57.{#SNMPINDEX}',10256,'{#DISK_LOCATION}: Physical disk S.M.A.R.T. status','system.hw.physicaldisk.smart_status[cpqDaPhyDrvSmartStatus.{#SNMPINDEX}]','3m','30d','0d',0,3,'','','',0,'','','','',0,'',NULL,70,'','',0,'','','','',0,2,NULL,'','MIB: CPQIDA-MIB\r\nPhysical Drive S.M.A.R.T Status.The following values are defined:\r\nother(1)  The agent is unable to determine if the status of S.M.A.R.T  predictive failure monitoring for this drive.\r\nok(2)  Indicates the drive is functioning properly.\r\nreplaceDrive(3)  Indicates that the drive has a S.M.A.R.T predictive failure  error and should be replaced.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28419,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.5.1.1.51.{#SNMPINDEX}',10256,'{#DISK_LOCATION}: Physical disk serial number','system.hw.physicaldisk.serialnumber[cpqDaPhyDrvSerialNum.{#SNMPINDEX}]','1d','30d','0',0,1,'','','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','MIB: CPQIDA-MIB\r\nPhysical Drive Serial Number.\r\nThis is the serial number assigned to the physical drive.\r\nThis value is based upon the serial number as returned by the SCSI inquiry command\r\nbut may have been modified due to space limitations.  This can be used for identification purposes.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28420,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.5.1.1.3.{#SNMPINDEX}',10256,'{#DISK_LOCATION}: Physical disk model name','system.hw.physicaldisk.model[cpqDaPhyDrvModel.{#SNMPINDEX}]','1h','2w','0',0,1,'','','',0,'','','','',