 The field will contain 0xFFFFFFFF if the drive capacity cannot be calculated\r\nor if the controller does not support SCSI drives.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28423,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.3.1.1.4.{#SNMPINDEX}',10256,'Disk {#SNMPINDEX}({#DISK_NAME}): Status','system.hw.virtualdisk.status[cpqDaLogDrvStatus.{#SNMPINDEX}]','3m','2w','365d',0,3,'','','',0,'','','','',0,'',NULL,75,'','',0,'','','','',0,2,NULL,'','Logical Drive Status.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28424,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.3.1.1.3.{#SNMPINDEX}',10256,'Disk {#SNMPINDEX}({#DISK_NAME}): Layout type','system.hw.virtualdisk.layout[cpqDaLogDrvFaultTol.{#SNMPINDEX}]','1h','2w','365d',0,3,'','','',0,'','','','',0,'',NULL,74,'','',0,'','','','',0,2,NULL,'','Logical Drive Fault Tolerance.\r\nThis shows the fault tolerance mode of the logical drive.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28425,4,'{$SNMP_COMMUNITY}','1.3.6.1.4.1.232.3.2.3.1.1.9.{#SNMPINDEX}',10256,'Disk {#SNMPINDEX}({#DISK_NAME}): Disk size','system.hw.virtualdisk.size[cpqDaLogDrvSize.{#SNMPINDEX}]','1h','2w','0d',0,3,'','B','',0,'','','','',0,'',NULL,NULL,'','',0,'','','','',0,2,NULL,'','Logical Drive Size.\r\nThis is the size of the logical drive in megabytes.  This value\r\nis calculated using the value 1,048,576 (2^20) as a megabyte.\r\nDrive manufacturers sometimes use the number 1,000,000 as a\r\nmegabyte when giving drive capacities so this value may\r\ndiffer from the advertised size of a drive.',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28426,3,'','',10257,'ICMP ping','icmpping','1m','1w','365d',0,3,'','','',0,'','','','',0,'',27138,1,'','',0,'','','','',0,0,NULL,'','',0,'30d',0,0,0,'',0,'',NULL,'3s','','','','200',1,0,'','',0,0,0,'','','',0,0,0),(28427,3,'','',10257,'ICMP loss','icmppingloss','1m','1w','365d',0,0,'',